import React from 'react';
import styles from "./App.module.css"
function App() {
  return (
    <>
    <div className={styles.container}>
      <div className={styles.heading}>
        <h1>Tic Tac Toe</h1>
      </div>
    </div>
    </>
  );
}

export default App;
